p.x:
var $bm_rt;
var motor, xo, yo, ax, ay, fx, fy, x, y;
motor = thisComp.layer('Nulo 5').effect('Motor')('Deslizador');
xo = value[0];
yo = value[1];
ax = $bm_mul(0, motor);
ay = $bm_mul(1, motor);
fx = 0.5;
fy = 2;
x = $bm_sum($bm_mul(Math.sin($bm_mul($bm_mul($bm_mul(time, Math.PI), 2), fx)), ax), xo);
y = $bm_sum($bm_mul(Math.cos($bm_mul($bm_mul($bm_mul(time, Math.PI), 2), fy)), ay), yo);
$bm_rt = [
    x,
    y
];

